import React, { useRef, useState, useEffect } from "react";
import {
    MDBContainer,
    MDBRow,
} from "mdbreact";
import Charts from "react-apexcharts";
export const TimeSeries = (props: any) => {
    const [chartoptions, setChartoptions] = useState({
        series: [{
          name: "Critical",
          data: [45, 52, 38, 24, 33, 26, 21, 20, 6, 8, 15, 10]
        },
        {
          name: "High",
          data: [35, 41, 62, 42, 13, 18, 29, 37, 36, 51, 32, 35]
        },
        {
          name: 'Medium',
          data: [56, 57, 74, 79, 75, 38, 62, 47, 72, 56, 45, 47]
        }
      ],
      options : {
        chart: {
        height: 150,
        type: 'line',
        zoom: {
          enabled: false
        },
      },
      colors: ['#f44336', '#ff9800', '#0784eb', '#2bbbad'],
    //   colors : ["#787878", "#5a5a5a", "#a6a6a6"],
      dataLabels: {
        enabled: false
      },
      stroke: {
        width: [2, 3, 2],
        dashArray: [0, 5, 3]
      },
      xaxis: {
        categories: ['Jan', 'Feb', 'Mrach', 'April', 'May', 'June', 'July', 'Aug', 'Sep',
          'Oct', 'Nov', 'Dec'
        ],
      },

      grid: {
        borderColor: '#f1f1f1',
      }
    }

});

    return (
        <>
            <Charts
                options={chartoptions.options}
                series={chartoptions.series}
                type="line"
                width="600"
            />
        </>
    )
}
